      id:"3",
      title:"Bread",
      amount:45.12,
      date:new Date(2022, 1, 5),
    },
    {
      id:"4",
      title:"Milk",
      amount:30.12,
      date:new Date(2023, 9, 1),
    },
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is also Visible! </p>
      <Expenses items={expenses}></Expenses>
      </div>
  );
}

export default App;
